window.bookSummaryJSON = "<p>On the eve of the global lockdown, Don Barlow opens the door of his old beachside cottage to find a pretty girl with pink-tipped hair, claiming to have nowhere to go.</p> <p>He allows her entry, and so begins a mystery set in unprecedented times: with the virus raging outside their home, the girl cannot be asked to leave, but what does he risk by having her stay?</p> <p>Caroline Overington is a bestselling Australian author and an award-winning journalist. She has written several bestselling audiobooks, including the <i>Looking for Eden</i>, <i>Ghost Child</i> and <i>I Came to Say Goodbye</i>. She has profiled many of the world's most famous women, including Oprah Winfrey and Hillary Clinton, and has twice won the Walkley Award for Investigative Journalism. She has also won the Sir Keith Murdoch Award for Journalistic Excellence and the Blake Dawson Prize for Business Literature. Caroline is currently Associate Editor at <i>The Australian</i> and is based in Sydney.</p>"; 
